import React from "react";
import { Link, useNavigate } from "react-router-dom";

const Navigate = () => {
  <nav>
    <Link to="/signin"></Link>
  </nav>;
};
const PrivateRoute = ({ user, children }) => {
  const { name } = user;

  if (!name) {
    return <Navigate to="/signin" replace />;
  }

  return children;
};

export default PrivateRoute;
